var imageList = document.querySelector("#images");

const images = {

    "female-warrior-sword-shield" : "data:image/png;base64,",
    "female-rogue-2-daggers" : "data:image/png;base64,",
    "female-warrior-2-swords" : "data:image/png;base64,",
    "female-mage-staff-book" : "data:image/png;base64,",
    "male-warrior-sword-shield-1" : "data:image/png;base64,",
    "male-mage-staff" : "data:image/png;base64,"
};


for(var $image in images){
    console.log($image)
    var newImageLi = document.createElement("li");
    var newImage = document.createElement("img");
    
    newImage.setAttribute("src", images[$image]);
    const name = document.createTextNode($image);
    
    newImageLi.appendChild(name);
    newImageLi.appendChild(newImage);
    imageList.appendChild(newImageLi)

}